 import { NavigateTo } from "../Hooks/NavigateHook";

const navigate = (to) =>
{
    window.history.pushState({}, '', to);
}

 function Link({to, children})
 {
    const handleClick = (event) =>
    {
        event.preventDefault();
        NavigateTo(to);
    }

    return <div>
        <a onClick={handleClick} href={to}>{children}</a>
    </div>
 }

 export default Link;
